import React, { useState, useEffect, useContext } from 'react'
import { NavLink } from "react-router-dom";
import { AdminContext } from "../../App"

const RentedCarsComponent = () => {
    const [rentedCars, setRentedCars] = useState([]);

    useEffect(() => {
        const fetchRentedCars = async () => {
            try {
                const response = await fetch('/rented-cars');
                const data = await response.json();
                setRentedCars(data);
            } catch (error) {
                console.error(error);
            }
        };

        fetchRentedCars();
    }, []);

    return (
        <div>
            <h1>Rented Cars</h1>
            {rentedCars.length > 0 ? (
                <ul>
                    {rentedCars.map((rentedCar) => (
                        <li key={rentedCar._id}>
                            <h2>{rentedCar.carData.brand}</h2>
                            <p>Rental Count: {rentedCar.rentalCount}</p>
                        </li>
                    ))}
                </ul>
            ) : (
                <p>No rented cars available.</p>
            )}
        </div>
    );
};

export default RentedCarsComponent;
